import {MDBContainer} from 'mdbreact';
import React from 'react';
import {Line} from 'react-chartjs-2';
import config from './config/defaultblueprint.json';

const bp = config.chartInfo.dataLine;
export type LineChartVProps = {
  lineChartData:any;
}


const LineChartV = (props:LineChartVProps) => {
  return (
    <MDBContainer>
      <h3 >Activity</h3>
      <Line  height={bp.height} data={props.lineChartData} options={{responsive: true}} />
    </MDBContainer>
  );
};

export default LineChartV;
